// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ShareDistribution {
    uint256 prime; // the prime number, defined the modulus
    uint256 secret; // the secret to be distributed
    uint256 numberOfParty; // the number of parties n
    mapping(uint256 => uint256) partyShare; // mapping containing the shares of the parties. [i] contains the share of party _i
    uint256 threshold; // the minimum number of parties to reconstruct
    uint256[] coefficients; // the coefficients used by the Dealer for constructing the shares

    constructor(uint256 n, uint256 t, uint256 size) {
        numberOfParty = n;
        threshold = t;
        coefficients = new uint256[](threshold - 1);
        prime = generatePrime(size);

        secret = uint256(keccak256(abi.encodePacked(block.timestamp))) % prime; // Generate a random secret

        for (uint256 i = 0; i < threshold - 1; i++) {
            coefficients[i] = uint256(keccak256(abi.encodePacked(block.timestamp + i))) % prime; // Generate coefficients
        }
    }

    function displayParameter() public view returns (uint256, uint256, uint256[] memory) {
        return (prime, secret, coefficients);
    }

    function constructShare() public {
        for (uint256 j = 1; j <= numberOfParty; j++) {
            uint256 index = j;
            uint256 share = 0;
            for (uint256 i = 0; i < threshold - 1; i++) {
                share += (coefficients[i] * index ** (threshold - 1 - i)) % prime; // evaluate the polynomial f(j)
            }
            partyShare[j] = (share + secret) % prime;
        }
    }

    function displayShares() public view returns (uint256[] memory) {
        uint256[] memory shares = new uint256[](numberOfParty);
        for (uint256 j = 1; j <= numberOfParty; j++) {
            shares[j - 1] = partyShare[j];
        }
        return shares;
    }

    function reConstruction(uint256[] memory indices) public view returns (uint256) {
        require(indices.length >= threshold, "Insufficient shares provided.");

        uint256 shareRecons = 0;
        for (uint256 i = 0; i < threshold; i++) {
            uint256 term = partyShare[indices[i]];
            for (uint256 j = 0; j < threshold; j++) {
                if (i != j) {
                    term *= (prime - indices[j]) * modInverse(indices[i] - indices[j], prime);
                    term %= prime;
                }
            }
            shareRecons += term;
        }
        return shareRecons % prime;
    }

    function generatePrime(uint256 size) private view returns (uint256) {
        uint256 candidate = uint256(keccak256(abi.encodePacked(block.timestamp))) % (2 ** size);
        if (candidate % 2 == 0) {
            candidate += 1;
        }
        while (!isPrime(candidate)) {
            candidate += 2;
        }
        return candidate;
    }

    function isPrime(uint256 n) private pure returns (bool) {
        if (n <= 1) {
            return false;
        }
        if (n <= 3) {
            return true;
        }
        if (n % 2 == 0 || n % 3 == 0) {
            return false;
        }
        for (uint256 i = 5; i * i <= n; i += 6) {
            if (n % i == 0 || n % (i + 2) == 0) {
                return false;
            }
        }
        return true;
    }

    function modInverse(uint256 a, uint256 m) private pure returns (uint256) {
        uint256 m0 = m;
        uint256 y = 0;
        uint256 x = 1;
        if (m == 1) {
            return 0;
        }
        while (a > 1) {
            uint256 q = a / m;
            uint256 t = m;
            m = a % m;
            a = t;
            t = y;
            y = x - q * y;
            x = t;
        }
        if (x < 0) {
            x += m0;
        }
        return x;
    }
}

